Aid.create!([
  {name: "Dispositif d'intéressement à la reprise d'activité", what: "<p>Ce dispositif vous permet de cumuler votre ASS avec la r&eacute;mun&eacute;ration que vous recevez lorsque vous reprenez une activit&eacute; salari&eacute;e ou non salari&eacute;e.</p>\r\n", slug: "dispositif-d-interessement-a-la-reprise-d-activite", short_description: "Cumul de votre ASS avec le revenu de votre activité pendant 3 mois ou 12 mois", how_much: "<p><strong>L&#39;activit&eacute; est reprise avant le 1er septembre 2017 :</strong></p>\r\n\r\n<p>Si l&#39;activit&eacute; reprise est sup&eacute;rieure &agrave; 78 heures/mois :</p>\r\n\r\n<ul>\r\n\t<li>les 3 premiers mois, vous percevez la totalit&eacute; de votre ASS + votre r&eacute;mun&eacute;ration</li>\r\n\t<li>du 4&egrave;me mois au 12&egrave;me mois, vous recevez un compl&eacute;ment d&#39;ASS en fonction de votre r&eacute;mun&eacute;ration + une prime forfaitaire mensuelle de 150 euros.</li>\r\n</ul>\r\n\r\n<p>Si l&#39;activit&eacute; reprise est inf&eacute;rieure &agrave; 78 heures/mois, vous b&eacute;n&eacute;ficiez du cumul d&eacute;gressif de votre ASS dans la limite de 12 mois &nbsp;et des droits restants.</p>\r\n\r\n<p><strong>L&#39;activit&eacute; est reprise apr&egrave;s le 1er septembre 2017 :&nbsp;</strong></p>\r\n\r\n<p>Vous cumulez int&eacute;gralement l&#39;ASS avec les revenus de votre activit&eacute; pendant 3 mois cons&eacute;cutifs ou non.&nbsp;</p>\r\n", additionnal_conditions: "<p>Il n&#39;y a pas d&#39;autre condition.</p>\r\n", how_and_when: "<p>Lors de votre actualisation mensuelle sur <a href=\"http://www.pole-emploi.fr/accueil/\" rel=\"noopener\" target=\"_blank\">pole-emploi.fr</a>, vous devrez d&eacute;clarer la reprise d&#39;activit&eacute; et scanner votre bulletin de salaire ou tout autre document justificatif si vous avez repris une activit&eacute; non salari&eacute;e.</p>\r\n", limitations: "", rule_id: 89, ordre_affichage: 40, contract_type_id: 6, archived_at: nil, last_update: ""},
  {name: "CUI-CIE Hauts de France", what: "<p>L&rsquo;objectif du CUI-CIE est de faciliter l&rsquo;insertion professionnelle des personnes sans emploi rencontrant des difficult&eacute;s sociales et professionnelles d&rsquo;acc&egrave;s &agrave; l&rsquo;emploi. Le CIE est conclu avec des employeurs du secteur marchand.</p>\r\n\r\n<p>Le CIE-Starter cible en particulier les jeunes de moins de 30 ans qui r&eacute;sident en quartier prioritaire de la ville (QPV) ou qui ont suivi un dispositif 2&egrave;me chance ou qui ont d&eacute;j&agrave; b&eacute;n&eacute;fici&eacute; d&#39;un emploi d&#39;avenir.</p>\r\n\r\n<p>Si vous &ecirc;tes &eacute;ligible &agrave; la fois au CIE et &agrave; l&#39;EAV, c&#39;est l&#39;emploi d&#39;avenir qui sera prioris&eacute;.</p>\r\n\r\n<p>Lorsqu&#39;il vous recrute en CUI-CIE, l&#39;employeur per&ccedil;oit une aide de l&#39;Etat dont le montant et la dur&eacute;e d&eacute;pendent &agrave; la fois de sa situation et de la votre.</p>\r\n\r\n<p>Puisque vous &ecirc;tes &eacute;ligible, vous pouvez utiliser cette information afin de valoriser votre candidature.&nbsp;</p>\r\n\r\n<p>En contrepartie, vous &ecirc;tes form&eacute;(e) &nbsp;dans l&#39;entreprise avec un tuteur d&eacute;sign&eacute; &agrave; cet effet.</p>\r\n\r\n<p>&nbsp;</p>\r\n", slug: "n-cui-cie-hauts-de-france", short_description: "Contrat Unique d'Insertion - contrat initiative emploi Hauts de France", how_much: "<p>L&#39;aide vers&eacute;e &agrave; l&#39;employeur varie entre 20 et 45% du taux du smic.</p>\r\n", additionnal_conditions: "<p>L&#39;&eacute;ligibilit&eacute; est calcul&eacute;e pour un lieu de travail situ&eacute; en Hauts de France.</p>\r\n\r\n<p>Pour conna&icirc;tre votre &eacute;ligibilit&eacute; dans une autre r&eacute;gion, vous devez contacter l&#39;agence p&ocirc;le emploi concern&eacute;e.</p>\r\n\r\n<p>Bient&ocirc;t, nous calculerons pour vous votre &eacute;ligibilit&eacute; dans l&#39;ensemble des r&eacute;gions.</p>\r\n", how_and_when: "<p>C&#39;est l&#39;employeur qui r&eacute;alise l&#39;ensemble des d&eacute;marches pour obtenir l&#39;aide de l&#39;Etat.</p>\r\n", limitations: "<p>Le recrutement en CUI-CIE est possible sous r&eacute;serve d&#39;enveloppe budg&eacute;taire suffisante.&nbsp;</p>\r\n\r\n<p>L&#39;employeur doit se renseigner sur l&#39;&eacute;tat de l&#39;enveloppe au moment de votre embauche.</p>\r\n\r\n<p>A noter : les crit&egrave;res d&#39;attribution varient en fonction de la r&eacute;gion dans laquelle est situ&eacute; le lieu de travail. Ils peuvent &ecirc;tre r&eacute;vis&eacute;s plusieurs fois par an.</p>\r\n", rule_id: 45, ordre_affichage: 0, contract_type_id: 5, archived_at: "2017-08-16 11:04:37", last_update: "Archivé"},
  {name: "Aide à la mobilité professionnelle des artistes et technicien(ne)s du spectacle", what: "<p>Cette aide du FONPEPS (Fonds de professionnalisation et&nbsp; de solidarit&eacute; des artistes et techniciens du spectacle) est une aide financi&egrave;re qui prend en charge totalement ou partiellement :</p>\r\n\r\n<ul>\r\n\t<li>les frais de transport (d&eacute;placement, carburant)</li>\r\n</ul>\r\n\r\n<p>ou</p>\r\n\r\n<ul>\r\n\t<li>les frais d&#39;h&eacute;bergement temporaire</li>\r\n</ul>\r\n\r\n<p>Elle est vers&eacute;e lorsque vous devez effectuer des d&eacute;placements fr&eacute;quents entre votre domicile et votre lieu de travail dans le cadre de votre projet professionnel.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", slug: "aide-a-la-mobilite-professionnelle-des-artistes-et-technicien-ne-s-du-spectacle", short_description: "Prise en charge des frais de déplacement ou d'hébergement temporaires", how_much: "<p>Cette aide a un caract&egrave;re social et le montant varie selon vos ressources**, la composition de votre foyer et si votre situation pr&eacute;sente un cas particulier de vuln&eacute;rabilit&eacute; (b&eacute;n&eacute;ficiaire des minimas sociaux, situation de handicap, reprise d&#39;une activit&eacute; professionnelle apr&egrave;s un arr&ecirc;t longue maladie ou qui fait suite &agrave; un accident de travail/maladie professionnelle).</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", additionnal_conditions: "<p>Vous justifiez de 5 ann&eacute;es (continues ou discontinues) d&#39;anciennet&eacute; en tant qu&#39;artiste ou technicien(ne) du spectacle.*</p>\r\n\r\n<p>Votre projet professionnel est valid&eacute; par un consultant sp&eacute;cialis&eacute; du FONPEPS.</p>\r\n\r\n<p>Vous &ecirc;tes embauch&eacute;(e) en CDD de plus de 6 mois ou en CDI dans un autre d&eacute;partement que celui de votre lieu de r&eacute;sidence actuel.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", how_and_when: "<p>Si vous n&#39;avez pas encore int&eacute;gr&eacute; le FONPEPS, vous devez suivre le circuit d&#39;orientation :&nbsp; <a href=\"http://www.artistesettechniciensduspectacle.fr/comment-ca-marche/le-circuit\" target=\"_blank\">circuit d&#39;orientation du FONPEPS.</a></p>\r\n\r\n<p>Si vous avez d&eacute;j&agrave; int&eacute;gr&eacute; le FONPEPS, vous devez contacter votre consultant sp&eacute;cialis&eacute; en charge de votre accompagnement.</p>\r\n\r\n<p><a href=\"https://www.pole-emploi.fr/informations/fonds-de-professionnalisation-et-de-solidarite-des-artistes-et-techniciens-du-spectacle-le-savez-vous--@/article.jspz?id=61245\" target=\"_blank\">En savoir plus sur le FONPEPS.</a></p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", limitations: "<p>L&#39;attribution de cette aide est sous r&eacute;serve de validation du consultant qui d&eacute;cide si elle est n&eacute;cessaire &agrave; votre accession &agrave; l&#39;emploi.</p>\r\n\r\n<p>Cette aide ne peut &ecirc;tre cumul&eacute;e qu&#39;avec une seule autre aide du FONPEPS (2 aides maximum).</p>\r\n\r\n<p>Elle intervient de fa&ccedil;on subsidiaire par rapport &agrave; d&#39;autres aides similaires.</p>\r\n\r\n<p>* Au titre des annexes VIII et/ou X du r&egrave;glement g&eacute;n&eacute;ral de l&#39;Unedic.</p>\r\n\r\n<p>** Plafonds au 1er janvier 2018 : 24130 euros pour une personne seule, 35470 euros pour un couple (plafonds relev&eacute;s de 3000 euros par enfant &agrave; charge)</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", rule_id: 164, ordre_affichage: 11, contract_type_id: 1, archived_at: nil, last_update: "Avril 2018"},
  {name: "Aide incitative à la reprise d'emploi (activité salariée)", what: "<p>Cette aide permet de cumuler l'Allocation d'aide au retour &agrave; l'emploi (ARE) &nbsp;avec une r&eacute;mun&eacute;ration (activit&eacute; professionnelle salari&eacute;e exerc&eacute;e en France ou &agrave; l'&eacute;tranger).</p>\r\n<p>Cette aide est vers&eacute;e lorsque vous reprenez un emploi et que le salaire est inf&eacute;rieur &agrave; votre allocation ch&ocirc;mage.</p>", slug: "aide-incitative-a-la-reprise-d-emploi", short_description: "Cumul d'une partie de l'allocation chômage avec votre salaire", how_much: "<p>Vous allez cumuler votre salaire avec une partie de votre allocation mensuelle.</p>\r\n<p>La partie de cette allocation est &eacute;gale &agrave; votre allocation pr&eacute;c&eacute;dente totale moins 70% de la r&eacute;mun&eacute;ration brute que vous percevez au titre de votre reprise d'emploi.</p>\r\n<p>Le montant d'allocation re&ccedil;u lorsque vous travaillez est donc inf&eacute;rieur &agrave; celui que vous receviez sans travailler. Ce diff&eacute;rentiel est converti en jours et permet de prolonger la dur&eacute;e de vos droits.</p>\r\n<p>Vous pouvez calculer le montant approximatif du compl&eacute;ment gr&acirc;ce &agrave; un <a href=\"https://candidat.pole-emploi.fr/candidat/simucalcul/repriseemploi\" target=\"_blank\" rel=\"noopener\">outil de simulation</a>.</p>", additionnal_conditions: "<p>Pour un mois donn&eacute;, le total (ARE + salaire) ne doit pas d&eacute;passer le montant du salaire brut que vous perceviez ant&eacute;rieurement.</p>", how_and_when: "<p>Lorsque vous reprenez une activit&eacute; professionnelle, vous devez informer P&ocirc;le emploi au moment de votre actualisation.</p>\r\n<p>Lorsque vous allez vous actualiser sur pole-emploi.fr ou par t&eacute;l&eacute;phone, vous allez d&eacute;clarer le nombre d'heures travaill&eacute;es dans le mois ainsi que le montant du salaire brut per&ccedil;u (ou une estimation si vous n'avez pas encore re&ccedil;u votre bulletin de paie).&nbsp;</p>\r\n<p>D&egrave;s que vous avez votre bulletin de paie, scannez-le depuis votre espace personnel <a href=\"http://www.pole-emploi.fr/accueil/\" target=\"_blank\" rel=\"noopener\">pole-emploi.fr</a>.</p>\r\n<p>Le calcul du compl&eacute;ment se fera automatiquement.</p>", limitations: "<p>Le cumul des allocations et des r&eacute;mun&eacute;rations ne peut exc&eacute;der le montant mensuel du salaire de r&eacute;f&eacute;rence.</p>", rule_id: 58, ordre_affichage: 41, contract_type_id: 6, archived_at: nil, last_update: nil},
  {name: "Aide à la création ou à la reprise d'entreprise (ACCRE)", what: "<p>L&#39;ACCRE est une aide qui peut &ecirc;tre demand&eacute;e dans le cadre de la cr&eacute;ation ou de la reprise d&#39;une entreprise.</p>\r\n\r\n<p>D&#39;autres crit&egrave;res peuvent vous rendre &eacute;ligible &agrave; l&#39;ACCRE d&#39;office :&nbsp;</p>\r\n\r\n<ul>\r\n\t<li>si vous &ecirc;tes b&eacute;n&eacute;ficiaire d&#39;une PrePareE (prestation partag&eacute;e d&#39;&eacute;ducation de l&#39;enfant)</li>\r\n\t<li>si vous &ecirc;tes salari&eacute;(e) et que vous reprenez une entreprise en difficult&eacute; (proc&eacute;dure collective)</li>\r\n\t<li>si vous cr&eacute;ez ou reprenez une entreprise dans un quartier prioritaire de la ville (QPV)</li>\r\n\t<li>si votre conjoint/concubin est b&eacute;n&eacute;ficiaire du RSA</li>\r\n\t<li>si vous n&#39;&ecirc;tes pas inscrit comme demandeur d&#39;emploi mais que vous percevez l&#39;ATA ou l&#39;ASS</li>\r\n</ul>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", slug: "accre", short_description: "Aide aux demandeurs d'emploi créant ou reprenant une entreprise", how_much: "<p>Il s&#39;agit d&#39;une exon&eacute;ration partielle de charges sociales pendant la premi&egrave;re ann&eacute;e d&#39;activit&eacute;.</p>\r\n\r\n<p>L&#39;obtention de l&#39;ACCRE est une condition d&#39;obtention de l&#39;ARCE.</p>\r\n\r\n<p>A partir de cette ann&eacute;e, tout cr&eacute;ateur/repreneur d&#39;entreprise est &eacute;ligible &agrave; l&#39;ACCRE, renomm&eacute;e &quot;exon&eacute;ration de d&eacute;but d&#39;activit&eacute;&quot; .&nbsp;</p>\r\n\r\n<ul>\r\n\t<li>Exon&eacute;ration totale si les revenus de l&#39;activit&eacute; sont inf&eacute;rieurs &agrave; 30393 euros en 2019</li>\r\n\t<li>Exon&eacute;ration d&eacute;gressive entre 30393 et 40524 euros de revenus</li>\r\n</ul>\r\n\r\n<p>Plus de pr&eacute;cisions sur le site <a href=\"https://www.service-public.fr/particuliers/vosdroits/F11677\" target=\"_blank\">service-public.fr.</a></p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", additionnal_conditions: "<p>Les revenus g&eacute;n&eacute;r&eacute;s par l&#39;activit&eacute; doivent &ecirc;tre inf&eacute;rieurs au plafond annuel de la s&eacute;curit&eacute; sociale (40524 euros en 2019).</p>\r\n\r\n<p>Pour b&eacute;n&eacute;ficier de l&#39;ACCRE, vous devez exercer le contr&ocirc;le de l&#39;entreprise individuelle ou de la soci&eacute;t&eacute; que vous cr&eacute;ez ou reprenez :&nbsp;</p>\r\n\r\n<ul>\r\n\t<li>soit vous d&eacute;tenez personnellement ou collectivement avec des membres de votre famille au moins 50 % du capital.*</li>\r\n\t<li>soit vous &ecirc;tes dirigeant et d&eacute;tenez au moins 1/3 du capital, personnellement ou collectivement avec des membres de votre famille. **&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>A savoir si vous &ecirc;tes indemnis&eacute;(e) en ASS :</strong></p>\r\n\r\n<ul>\r\n\t<li>vous obtenez l&#39;ACCRE, vous pouvez continuer &agrave; percevoir l&#39;ASS pendant 12 mois.</li>\r\n\t<li>vous n&#39;obtenez pas l&#39;ACCRE, vous continuez &agrave; percevoir l&#39;ASS en totalit&eacute; pendant 3 mois, cons&eacute;cutifs ou non. Apr&egrave;s ces 3 mois, le versement de votre ASS est interrompu en cas de poursuite de l&#39;activit&eacute;. Vous pouvez alors percevoir une prime d&#39;activit&eacute; si vous remplissez les conditions d&#39;&eacute;ligibilit&eacute;.</li>\r\n</ul>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", how_and_when: "<p>Vous devez remplir un formulaire de demande d&#39;ACCRE : <a href=\"https://www.formulaires.modernisation.gouv.fr/gf/cerfa_13584.do\" target=\"_blank\">t&eacute;l&eacute;charger le formulaire</a>.</p>\r\n\r\n<p>Vous pouvez d&eacute;poser ce formulaire au&nbsp; <a href=\"http://www.cci.fr/web/accomplir-ses-formalites/centres-de-formalites-des-entreprises/-/article/Simplifiez+vos+d%C3%83%C2%A9marches/Simplifiez+vos+d%C3%83%C2%A9marches+administratives+avec+le+CFE\" rel=\"noopener\" target=\"_blank\">Centre de Formalit&eacute;s des Entreprises (CFE)</a> comp&eacute;tent dans les 45 jours qui suivent le d&eacute;p&ocirc;t de d&eacute;claration de cr&eacute;ation ou de reprise de l&#39;entreprise.</p>\r\n\r\n<p>Avec ce formulaire, vous devez joindre des justificatifs selon votre situation (notification d&#39;ouverture de droits si vous &ecirc;tes indemnis&eacute; en ARE, ATA ou ASS, justificatif d&#39;attribution du RSA, ...).</p>\r\n\r\n<p>Le CFE transmet ensuite le dossier complet &agrave; l&#39;Urssaf qui donne sa d&eacute;cision d&#39;attribution ou de non-attribution dans le mois qui suit.</p>\r\n\r\n<p>Plus d&#39;informations sur le site <a href=\"https://www.afecreation.fr/\" rel=\"noopener\" target=\"_blank\">afecreation.fr</a></p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", limitations: "<p>* La condition est remplie si vous d&eacute;tenez 35 % &agrave; titre personnel et que votre conjoint, partenaire pacs&eacute;, concubin, enfant ou parent d&eacute;tient (ou d&eacute;tiennent collectivement) au moins 15 % du capital.</p>\r\n\r\n<p>** Sous r&eacute;serve qu&#39;un autre associ&eacute; ne d&eacute;tienne pas directement ou indirectement plus de la moiti&eacute; du capital.</p>\r\n\r\n<p>Ces conditions doivent &ecirc;tre r&eacute;unies au minimum pendant 2 ans.</p>\r\n\r\n<p>D&#39;autres informations sur :</p>\r\n\r\n<ul>\r\n\t<li>l&#39;Emploi Store, rubrique <a href=\"https://www.emploi-store.fr/portail/centredinteret/creeruneentreprise\" rel=\"noopener\" target=\"_blank\">Cr&eacute;er une entreprise</a></li>\r\n\t<li>le <a href=\"http://les-aides.fr/\" rel=\"noopener\" target=\"_blank\">site d&#39;information des CCI</a></li>\r\n</ul>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", rule_id: 66, ordre_affichage: 30, contract_type_id: 2, archived_at: nil, last_update: "Mars 2018"},
  {name: "Aides à l'obtention de fonds pour la création d'entreprise", what: "<p>Il existe de nombreux concours&nbsp;destin&eacute;s aux cr&eacute;ateurs/trices d&#39;entreprise.</p>\r\n\r\n<p>Le simple fait de participer &agrave; ces concours vous permet :</p>\r\n\r\n<ul>\r\n\t<li>d&#39;apporter de la visibilit&eacute; &agrave; votre entreprise</li>\r\n\t<li>de rencontrer des partenaires et/ou financeurs potentiels.</li>\r\n</ul>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", slug: "aides-a-l-obtention-de-fonds-pour-la-creation-d-entreprise", short_description: "Aides permettant d'obtenir une visibilité et/ou des fonds pour votre activité", how_much: "<p>Dans le cadre des concours de cr&eacute;ateurs/trices d&#39;entreprise, il existe une dotation qui peut rev&ecirc;tir diff&eacute;rentes formes : une subvention financi&egrave;re, une participation aux frais de communication, un droit au bail dans un centre commercial, une prestation d&#39;accompagnement, la prise en charge d&#39;un stand sur un grand salon...</p>\r\n\r\n<p>Quelques exemples de concours :</p>\r\n\r\n<ul>\r\n\t<li>concours Talents de la cr&eacute;ation, organis&eacute; par la BGE : <a href=\"http://www.concours-talents.com/\" target=\"_blank\">en savoir +</a></li>\r\n\t<li>concours I-LAB, organis&eacute; par le Minist&egrave;re de l&#39;Enseignement sup&eacute;rieur et de la recherche : <a href=\"http://www.enseignementsup-recherche.gouv.fr/pid24633/i-lab-concours-national-d-aide-a-la-creation-d-entreprises-de-technologies-innovantes-et-prix-pepite.html\" target=\"_blank\">en savoir +</a></li>\r\n\t<li>concours Agropole, pour les entreprises innovantes du secteur agroalimentaire : <a href=\"https://www.agropole.com/presentation-du-concours.html\" target=\"_blank\">en savoir +</a></li>\r\n\t<li>concours D&eacute;clic Jeunes, organis&eacute; par la Fondation de France : <a href=\"https://www.fondationdefrance.org/fr/concours-declics-jeunes-0\" target=\"_blank\">en savoir +</a></li>\r\n\t<li>concours Startup contest : <a href=\"https://www.startupcontest.fr/\" target=\"_blank\">en savoir +</a></li>\r\n\t<li>prix Moovjee : <a href=\"http://www.moovjee.fr/prix-moovjee/\" target=\"_blank\">en savoir +</a></li>\r\n\t<li>concours 100 jours pour entreprendre : <a href=\"http://www.100jourspourentreprendre.fr/\" target=\"_blank\">en savoir +</a></li>\r\n</ul>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", additionnal_conditions: "<p>Certains concours sont g&eacute;n&eacute;ralistes, d&#39;autres sont th&eacute;matiques : vous devez prendre connaissance des modalit&eacute;s pour chacun d&#39;entre eux. (par exemple, il existe des concours r&eacute;serv&eacute;s aux femmes cr&eacute;atrices d&#39;entreprise, d&#39;autres qui concernent l&#39;innovation sur certains secteurs, ...).</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", how_and_when: "<p>Bien souvent, il vous est demand&eacute; de constituer un dossier ou remplir un formulaire : cela d&eacute;pend des concours. Pour consulter la liste des concours, rendez-vous sur le <a href=\"https://les-aides.fr/concours/\" target=\"_blank\">site d&#39;information de la CCI</a> ou sur le site de l&#39;<a href=\"https://www.afecreation.fr/pid563/concours.html\" target=\"_blank\">Agence France Entrepreneur.</a></p>\r\n\r\n<p>Vous devez &ecirc;tre attentif/ve aux p&eacute;riodes d&#39;ouverture et de cl&ocirc;ture pour le d&eacute;p&ocirc;t des dossiers : il y a des concours tout au long de l&#39;ann&eacute;e.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", limitations: "<p>Il existe d&#39;autres aides aux entreprises : pour les conna&icirc;tre, consultez le site <a href=\"https://les-aides.fr/\" target=\"_blank\">les-aides.fr</a> de la CCI, par exemple, celles du fonds d&#39;investissement pour les services, l&#39;artisanat et le commerce (<a href=\"https://www.afecreation.fr/pid911/aides-du-fisac.html\" target=\"_blank\">FISAC</a>).</p>\r\n\r\n<p>D&#39;autres informations disponibles sur le <a href=\"https://www.afecreation.fr/pid1740/par-qui-se-faire-aider.html&amp;tp=1\" target=\"_blank\">site de l&#39;Agence France Entrepreneur (AFE).</a></p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", rule_id: 104, ordre_affichage: 33, contract_type_id: 2, archived_at: nil, last_update: ""},
  {name: "Activ'projet", what: "<p>Un professionnel de l'orientation vous accompagne pour d&eacute;finir votre projet professionnel,&nbsp;en lien avec le march&eacute; du travail et les comp&eacute;tences recherch&eacute;es par les entreprises.</p>", slug: "activ-projet", short_description: "Aide à l'orientation qui permet d'élaborer ou confirmer un ou plusieurs projets professionnels", how_much: "<p>La prestation dure 8 semaines maximum, et comporte au minimum 3 entretiens au cours desquels vous entamez une r&eacute;flexion sur votre &eacute;volution et votre orientation.</p>\r\n<p>Vous construisez votre projet professionnel avec un psychologue du travail P&ocirc;le emploi ou un organisme prestataire.</p>", additionnal_conditions: "<p>Vous avez identifi&eacute; une piste professionnelle et vous avez de l'exp&eacute;rience dans un ou plusieurs m&eacute;tiers.</p>\r\n<p>ou&nbsp;</p>\r\n<p>Vous souhaitez ou devez changer de m&eacute;tier.</p>\r\n<p>ou</p>\r\n<p>Vous n'avez pas d'id&eacute;e du m&eacute;tier que vous souhaitez exercer.</p>", how_and_when: "<p>Au cours d'un entretien avec votre conseiller r&eacute;f&eacute;rent P&ocirc;le emploi, vous lui faites part de votre situation et de votre souhait d'&eacute;volution professionnelle.</p>\r\n<p>Ce premier entretien d'analyse permettra &agrave; la fois de formaliser votre demande de prestation et aussi d'&eacute;laborer un contenu adapt&eacute; &agrave; vos besoins.</p>\r\n<p>Contactez votre conseiller r&eacute;f&eacute;rent en vous connectant sur votre espace personnel : <a href=\"https://candidat.pole-emploi.fr/candidat/espacepersonnel/authentification/\" target=\"_blank\" rel=\"noopener\">P&ocirc;le emploi.fr</a></p>", limitations: "<p>Sous r&eacute;serve de l'analyse r&eacute;alis&eacute;e par votre conseiller r&eacute;f&eacute;rent qui examinera si la prestation Activ'projet est adapt&eacute;e &agrave; votre situation.</p>\r\n<p>Vous pouvez b&eacute;n&eacute;ficier de cette prestation seulement une fois.</p>", rule_id: 37, ordre_affichage: 11, contract_type_id: 4, archived_at: nil, last_update: nil},
  {name: "Volontariat de solidarité internationale (VSI)", what: "<p>Vous vous engagez comme volontaire dans des associations qui ont pour objet des actions de solidarit&eacute; internationale dans le domaine de l&#39;enseignement, du d&eacute;veloppement, du d&eacute;veloppement rural, de la sant&eacute; (parfois pour des actions d&#39;urgences).</p>\r\n\r\n<p>Par exemple (liste non exhaustive) &nbsp;:&nbsp;Action Contre la Faim,&nbsp;ATD Quart Monde,&nbsp;Croix Rouge fran&ccedil;aise, Handicap international, M&eacute;decins du monde, Plan&egrave;te enfants, ...*</p>\r\n\r\n<p>La mission dure entre 6 mois et 2 ans.**</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", slug: "vsi-volontariat-de-solidarite-internationale", short_description: "Missions effectuées en dehors de l'espace économique européen et au sein d'associations agréées", how_much: "<p>Le montant minimum de votre indemnisation est de 100 euros par mois, hors prise en charge du logement, du transport et de la nourriture.***</p>\r\n\r\n<p>Vous &ecirc;tes affili&eacute; &agrave; un r&eacute;gime de s&eacute;curit&eacute; sociale qui couvre la maladie, la maternit&eacute;, l&#39;invalidit&eacute;, le d&eacute;c&egrave;s, l&#39;accident du travail et maladies professionnelles.&nbsp;</p>\r\n\r\n<p>L&#39;association prend en charge pour vous et vos ayants droit une assurance maladie compl&eacute;mentaire, une assurance responsabilit&eacute; civile et une assurance rapatriement sanitaire.</p>\r\n\r\n<p>En fin de mission, vous pouvez b&eacute;n&eacute;ficier de :</p>\r\n\r\n<ul>\r\n\t<li>la prime d&#39;insertion professionnelle si vous &ecirc;tes inscrit/e comme demandeur d&#39;emploi et que vous ne remplissez pas les conditions pour avoir le RSA. Cette prime est d&#39;un montant de &nbsp;2001 euros maximum, vers&eacute;e tous les 3 mois pendant 9 mois maximum</li>\r\n\t<li>l&#39;indemnit&eacute; de r&eacute;installation si vous avez effectu&eacute; au moins 24 mois de mission en continu. Son montant est de 3700 euros.</li>\r\n</ul>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", additionnal_conditions: "<p>Vous devez accomplir votre mission en dehors du pays dont vous &ecirc;tes ressortissant/e ou r&eacute;sident/e.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", how_and_when: "<p>Pour trouver une mission, vous pouvez contacter directement les associations agr&eacute;es pour le VSI ou vous rendre sur la <a href=\"http://www.france-volontaires.org\" rel=\"noopener\" target=\"_blank\">plateforme France volontaires.</a></p>\r\n\r\n<p>Ensuite, vous signez un contrat de VSI avec l&#39;association qui vous forme et prend en charge les frais de voyages li&eacute;s &agrave; votre mission.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", limitations: "<p>* <a href=\"http://www.diplomatie.gouv.fr/IMG/pdf/liste_associations_agreees_2016_cle419424.pdf\" rel=\"noopener\" target=\"_blank\">Liste compl&egrave;te</a></p>\r\n\r\n<p>** La dur&eacute;e cumul&eacute;e des diff&eacute;rentes missions ne peut pas exc&eacute;der 6 ans.</p>\r\n\r\n<p>*** Il ne s&#39;agit pas d&#39;un salaire : il n&#39;y a donc pas d&#39;imposition sur le revenu et pas de pr&eacute;l&egrave;vement au titre des contributions et cotisations sociales.</p>\r\n\r\n<p>Voir toutes les opportunit&eacute;s sur le <a href=\"http://www.decouvrirlemonde.jeunes.gouv.fr/\" target=\"_blank\">portail gouvernemental pour la mobilit&eacute; des jeunes.</a></p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", rule_id: 61, ordre_affichage: 64, contract_type_id: 3, archived_at: nil, last_update: ""},
  {name: "Accès des Demandeurs d'emploi aux Métiers Agricoles (ADEMA)", what: "<p>Le secteur agricole offre beaucoup de d&eacute;bouch&eacute;s sur diverses activit&eacute;s telles que le commerce, la logistique,...exerc&eacute;es en travail d&#39;&eacute;quipe ou en solitaire.</p>\r\n\r\n<p>ADEMA est particuli&egrave;rement adapt&eacute; &agrave; votre profil si vous &ecirc;tes attir&eacute;/e par le plein air, les machines agricoles, les animaux, les plantes.&nbsp;</p>\r\n\r\n<p>ADEMA est un dispositif qui vous permet de d&eacute;couvrir les m&eacute;tiers de l&#39;agriculture, gr&acirc;ce &agrave; un parcours d&#39;une dur&eacute;e de 1 mois.</p>\r\n\r\n<p>Pendant cette p&eacute;riode, vous allez d&eacute;couvrir diff&eacute;rents secteurs agricoles, apprendre les premi&egrave;res bases du m&eacute;tier et faire un stage en entreprise agricole.</p>\r\n", slug: "adema-acces-des-demandeurs-d-emploi-aux-metiers-agricoles", short_description: "Dispositif de découverte des métiers de l'agriculture avec une formation rémunérée", how_much: "<p>Vous b&eacute;n&eacute;ficiez d&#39;une formation gratuite** pendant laquelle vous serez accompagn&eacute;/e &nbsp;par des professionnels et gr&acirc;ce &agrave; laquelle vous pourrez&nbsp;acqu&eacute;rir de nouvelles comp&eacute;tences.</p>\r\n\r\n<p>Si vous &ecirc;tes indemnis&eacute;/e, vous continuez &agrave; percevoir votre allocation et &ecirc;tes stagiaire de la formation professionnelle.***</p>\r\n\r\n<p>Si vous n&#39;&ecirc;tes pas indemnis&eacute;/e, vous pouvez percevoir une allocation de 660 euros (&agrave; condition d&#39;&ecirc;tre pr&eacute;sent/e jusqu&#39;au bilan final).</p>\r\n", additionnal_conditions: "<p>Vous ne connaissez pas les m&eacute;tiers agricoles ou du paysage.*</p>\r\n\r\n<p>Vous ne devez pas exercer d&#39;activit&eacute; professionnelle.</p>\r\n", how_and_when: "<p>Prenez contact avec votre conseiller r&eacute;f&eacute;rent P&ocirc;le emploi qui vous orientera vers l&#39;un des <a href=\"http://www.fafsea.com/adema/candidats/agenda/region.html\" rel=\"noopener\" target=\"_blank\">centres ADEMA</a>.</p>\r\n\r\n<p>Le centre vous aidera &agrave; valider votre projet et &agrave; remplir votre dossier d&#39;inscription.</p>\r\n\r\n<p><a href=\"http://www.fafsea.com/adema/\" rel=\"noopener\" target=\"_blank\">En savoir + sur le dispositif ADEMA.</a></p>\r\n", limitations: "<p>* Vous n&#39;avez jamais suivi de formation agricole ou exerc&eacute; un m&eacute;tier agricole de plus de 3 mois.</p>\r\n\r\n<p>** La formation est financ&eacute;e par le FAFSEA : si vous avez d&eacute;j&agrave; b&eacute;n&eacute;fici&eacute; d&#39;un financement FAFSEA au cours des 36 derniers mois, vous ne pourrez donc pas mobiliser le dispositif ADEMA.</p>\r\n\r\n<p>*** Si vous &ecirc;tes b&eacute;n&eacute;ficiaire du RSA, rapprochez-vous du service social.</p>\r\n", rule_id: 37, ordre_affichage: 17, contract_type_id: 4, archived_at: nil, last_update: "Mars 2018"},
  {name: "Rémunération publique des stagiaires (RPS)", what: "<p>La r&eacute;mun&eacute;ration publique des stagiaires (RPS) est vers&eacute;e lorsque vous suivez une formation suivie dans le cadre de stages agr&eacute;&eacute;s et propos&eacute;s par l'Etat ou la r&eacute;gion.</p>\r\n<p>La RPS n'est vers&eacute;e que pour les heures de formation r&eacute;alis&eacute;es (elle sera vers&eacute;e partiellement en cas d'absence non justifi&eacute;e).</p>", slug: "rps-remuneration-publique-des-stagiaires", short_description: "Revenu versé pendant une formation proposée par l'Etat ou la région", how_much: "<p>Le montant de la RPS varie selon votre profil et/ou la dur&eacute;e de votre ancienne activit&eacute;.</p>\r\n<p>Si vous n'avez jamais travaill&eacute;, elle varie entre 130 et 401 euros par mois selon l'&acirc;ge.</p>\r\n<p>Si vous avez &eacute;t&eacute; travailleur/euse non salari&eacute;/e, elle est de 708 euros par mois.</p>\r\n<p>Si vous &ecirc;tes dans une situation familiale particuli&egrave;re (personnes veuves, divorc&eacute;es, s&eacute;par&eacute;es, c&eacute;libataire avec enfant &agrave; charge, ...), elle est de 652 euros par mois.</p>\r\n<p>Si vous avez exerc&eacute; une activit&eacute; salari&eacute;e, elle est de 652 euros par mois.</p>\r\n<p>Si vous &ecirc;tes reconnu/e travailleur/euse handicap&eacute;/e, elle varie entre 652 euros et 1932 euros. Vous pouvez opter pour la RPS si vous &ecirc;tes indemnis&eacute; en ARE.</p>", additionnal_conditions: "<p>Travailleurs/euses non-salari&eacute;/es : avoir exerc&eacute; une activit&eacute; professionnelle pendant 12 mois dans les 3 ann&eacute;es avant l'entr&eacute;e en stage.</p>\r\n<p>Travailleurs/euses salari&eacute;/es : avoir exerc&eacute; une activit&eacute; professionnelle d'au moins 6 mois dans les 12 derniers mois.</p>\r\n<p>B&eacute;n&eacute;ficiaires de l'ATA ou de l'ASS : vous pouvez cumuler votre allocation avec la RPS si la formation est d'une dur&eacute;e inf&eacute;rieure ou &eacute;gale &agrave; 40 heures.*&nbsp;</p>\r\n<p>B&eacute;n&eacute;ficiaires du RSA : vous pouvez percevoir un diff&eacute;rentiel de RPS.</p>", how_and_when: "<p>L'organisme de formation vous remet un dossier que vous devez remplir, signer et rendre.</p>\r\n<p>L'organisme de formation effectue le reste des d&eacute;marches.</p>", limitations: "<p>* Si la formation dure plus de 40 heures, l'ASS et l'ATA cessent d'&ecirc;tre vers&eacute;es pendant la dur&eacute;e de la formation.</p>", rule_id: 112, ordre_affichage: 76, contract_type_id: 8, archived_at: nil, last_update: nil},
  {name: "Évaluation des compétences et connaissances professionnelles (ECCP )", what: "<p>Cette aide permet :</p>\r\n\r\n<ul>\r\n\t<li>de faire un bilan des comp&eacute;tences et connaissances professionnelles</li>\r\n\t<li>d&#39;identifier et valoriser les points forts pour une recherche d&#39;emploi</li>\r\n\t<li>de d&eacute;finir un plan d&#39;actions pour permettre de se postionner sur d&#39;autres m&eacute;tiers cibl&eacute;s</li>\r\n\t<li>de d&eacute;finir ou pr&eacute;ciser les besoins exacts de formation</li>\r\n</ul>\r\n", slug: "eccp", short_description: "L'ECCP permet d'identifier des compétences et de définir un plan d'actions pour le retour à l'emploi", how_much: "<p>L&#39;ECCP est anim&eacute;e par un prestataire conventionn&eacute; par P&ocirc;le emploi, pendant 4 &agrave; 7 heures selon le(s) m&eacute;tier(s) &agrave; &eacute;valuer.</p>\r\n\r\n<p>Elle se d&eacute;roule en 3 phases :&nbsp;</p>\r\n\r\n<ul>\r\n\t<li>information : le d&eacute;roul&eacute; et les outils d&#39;&eacute;valuation vous sont pr&eacute;sent&eacute;s</li>\r\n\t<li>&eacute;valuation : vous passez des tests, &eacute;preuves ou mises en situation</li>\r\n\t<li>bilan : le prestataire r&eacute;alise une analyse une synth&egrave;se et un bilan</li>\r\n</ul>\r\n\r\n<p>La synth&egrave;se de l&#39;&eacute;valuation et le bilan de la prestation sont mis &agrave; votre disposition dans votre espace personnel sur p&ocirc;le-emploi.fr</p>\r\n\r\n<p>Vous pouvez ainsi les utiliser dans le cadre d&#39;un processus de recrutement ou pour accompagner vos candidatures.</p>\r\n", additionnal_conditions: "<p>Il n&#39;y a pas d&#39;autre condition &agrave; remplir que d&#39;&ecirc;tre inscrit/e &agrave; P&ocirc;le emploi.</p>\r\n", how_and_when: "<p>Contactez votre conseiller r&eacute;f&eacute;rent P&ocirc;le emploi pour faire la demande.</p>\r\n\r\n<p>Acc&eacute;dez &agrave; votre espace personnel <a href=\"http://www.pole-emploi.fr/accueil/\" rel=\"noopener\" target=\"_blank\">P&ocirc;le emploi.fr</a></p>\r\n", limitations: "<p>Votre conseiller r&eacute;f&eacute;rent P&ocirc;le emploi examine la pertinence de la mise en oeuvre de l&#39;ECCP au regard de votre situation et de vos besoins.</p>\r\n", rule_id: 37, ordre_affichage: 13, contract_type_id: 4, archived_at: nil, last_update: ""},
  {name: "Aide à la mobilité Agefiph", what: "<p>Cette aide vise &agrave; faciliter les d&eacute;placements des personnes handicap&eacute;es salari&eacute;es, travailleurs ind&eacute;pendants, demandeurs d&#39;emploi, &eacute;tudiants de l&#39;enseignement sup&eacute;rieur en stage obligatoire, stagiaires de la formation professionnelle.</p>\r\n\r\n<p>Elle permet la prise en charge des surco&ucirc;ts en lien avec le handicap pour les d&eacute;placements&nbsp;: &eacute;quipements pour adapter un v&eacute;hicule, am&eacute;nagement du v&eacute;hicule de la personne qui vous accompagne, taxi, transport adapt&eacute;.</p>\r\n", slug: "aide-a-la-mobilite-agefiph", short_description: "Aide au financement de dépenses liées au déplacement pour les travailleurs handicapés (aménagement d'un véhicule adapté, aide ponctuelle aux trajets, ...)", how_much: "<p>L&#39;aide est d&#39;un montant maximum de 5000 euros.</p>\r\n\r\n<p>L&#39;aide peut &ecirc;tre renouvel&eacute;e :&nbsp;</p>\r\n\r\n<ul>\r\n\t<li>tous les 5 ans si elle concerne l&#39;adaptation de votre v&eacute;hicule,</li>\r\n\t<li>selon votre situation lorsque l&#39;aide concerne un autre type de prise en charge</li>\r\n</ul>\r\n", additionnal_conditions: "", how_and_when: "<p>Vous pouvez faire la demande directement aupr&egrave;s de l&#39;<a href=\"https://www.agefiph.fr/Personne-handicapee/Projet-professionnel-et-formation/Sameth-vous-accompagne\" rel=\"noopener\" target=\"_blank\">Agefiph</a>.&nbsp;</p>\r\n\r\n<p>Pour la formaliser, vous pouvez &ecirc;tre aid&eacute;(e) par le conseiller qui vous accompagne dans le cadre de votre recherche d&#39;emploi (<a href=\"http://www.capemploi.com/\" rel=\"noopener\" target=\"_blank\">Cap emploi</a>, <a href=\"http://www.pole-emploi.fr/accueil/\" rel=\"noopener\" target=\"_blank\">P&ocirc;le emploi</a> ou <a href=\"http://www.mission-locale.fr/\" rel=\"noopener\" target=\"_blank\">mission locale</a>) ou du <a href=\"https://www.agefiph.fr/Personne-handicapee/Projet-professionnel-et-formation/Sameth-vous-accompagne\" rel=\"noopener\" target=\"_blank\">Sameth</a> si vous &ecirc;tes salari&eacute; (service d&#39;appui au maintien dans l&#39;emploi des travailleurs handicap&eacute;s).</p>\r\n", limitations: "<p><a href=\"https://www.agefiph.fr/Les-services-et-aides-financieres-de-l-Agefiph/Aide-aux-deplacements-des-personnes-handicapees\" target=\"_blank\">En savoir + sur le site de l&#39;Agefiph</a></p>\r\n\r\n<p>&nbsp;</p>\r\n", rule_id: 14, ordre_affichage: 7, contract_type_id: 1, archived_at: nil, last_update: ""},
  {name: "Aide incitative à la reprise d'emploi (activité non salariée)", what: "<p>Vous pouvez cumuler une partie de votre allocation avec les revenus d'une activit&eacute; professionnelle non salari&eacute;e.</p>", slug: "aide-incitative-a-la-reprise-d-emploi-activite-non-salariee", short_description: "Cumul d'une partie de l'allocation chômage avec les revenus d'une activité non salariée", how_much: "<p>L'allocation que vous percevez au titre de cette aide est calcul&eacute;e de la fa&ccedil;on suivante :</p>\r\n<p>0,8 X (montant de votre allocation - 70% des r&eacute;mun&eacute;rations d&eacute;clar&eacute;es au titre des assurances sociales).</p>\r\n<p>Si les revenus sont justifi&eacute;s, le coefficient de 0,8 ne s'applique pas.</p>\r\n<p>Lorsque les revenus ne sont pas connus ou lorsque l'activit&eacute; d&eacute;bute, le compl&eacute;ment d'allocation est &eacute;gal &agrave; 70% de votre allocation initiale.</p>\r\n<p>La diff&eacute;rence entre l'allocation que vous percevez sans travailler et celle que vous cumulez avec vos revenus prolonge votre dur&eacute;e d'indemnisation.</p>", additionnal_conditions: "<p>Vous ne pouvez pas b&eacute;n&eacute;ficer de cette aide si vous avez obtenu l'ARCE.</p>", how_and_when: "<p>Vous devez informer P&ocirc;le emploi que vous exercez une activit&eacute; professionnelle dans les 72 heures.</p>\r\n<p>Vous signalerez cette activit&eacute; lors de votre actualisation sur pole-emploi.fr.</p>", limitations: "<p>* Le cumul des allocations et des r&eacute;mun&eacute;rations ne peut exc&eacute;der le montant mensuel du salaire journalier de r&eacute;f&eacute;rence.</p>\r\n<p>Une r&eacute;gularisation annuelle est effectu&eacute;e &agrave; partir des r&eacute;mun&eacute;rations r&eacute;elles soumises &agrave; cotisations.</p>", rule_id: 58, ordre_affichage: 32, contract_type_id: 2, archived_at: nil, last_update: nil},
  {name: "Insertion par l'activité économique (IAE)", what: "<p>Vous b&eacute;n&eacute;ficiez d&#39;un accompagnement renforc&eacute; et vous pouvez signer&nbsp;un contrat de travail dans une structure sp&eacute;cialis&eacute;e en insertion sociale qui peut &ecirc;tre :</p>\r\n\r\n<ul>\r\n\t<li>une entreprise d&#39;insertion</li>\r\n\t<li>une entreprise de travail temporaire d&#39;insertion</li>\r\n\t<li>un atelier ou chantier d&#39;insertion</li>\r\n\t<li>une association interm&eacute;diaire*</li>\r\n</ul>\r\n\r\n<p>Le contrat initial est renouvelable mais pour une dur&eacute;e totale de 24 mois maximum.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", slug: "insertion-par-l-activite-economique-iae", short_description: "Accompagnement dans l'emploi pour les personnes très éloignées de l'emploi", how_much: "<p>Vous &ecirc;tes accompagn&eacute;/e au sein d&#39;une structure qui prend en compte vos difficult&eacute;s et qui vous aide &agrave; vous ins&eacute;rer par le biais du travail.</p>\r\n\r\n<p>Avant de sortir de ce dispositif, vous b&eacute;n&eacute;ficiez d&#39;un suivi et d&#39;un accompagnement sp&eacute;cifique qui peut se traduire par une &eacute;valuation, un bilan de comp&eacute;tences, des ateliers de recherche d&#39;emploi, ...</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", additionnal_conditions: "<p>Vous rencontrez des difficult&eacute;s sociales et professionnelles particuli&egrave;res.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", how_and_when: "<p>Pour &ecirc;tre embauch&eacute;/e dans une structure d&#39;insertion par l&#39;activit&eacute; &eacute;conomique, vous devez au pr&eacute;alable obtenir un diagnostic IAE aupr&egrave;s de votre conseiller/&egrave;re&nbsp;emploi (P&ocirc;le emploi, Mission locale ou, dans certaines r&eacute;gions, services sociaux)&nbsp;qui d&eacute;terminera, selon votre profil et votre situation, si le dispositif IAE est adapt&eacute; pour vous.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", limitations: "<p>*<a href=\"http://travail-emploi.gouv.fr/emploi/insertion-dans-l-emploi/insertion-par-l-activite-economique/\" target=\"_blank\">En savoir plus sur les diff&eacute;rents types de structure</a></p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", rule_id: 168, ordre_affichage: 17, contract_type_id: 6, archived_at: nil, last_update: ""},
  {name: "Parcours d'accès aux carrières territoriales, hospitalières et d'Etat (PACTE)", what: "<p>Le PACTE vous permet d&#39;acc&eacute;der sans concours &agrave; un emploi de cat&eacute;gorie C de la fonction publique, tout en suivant une formation en alternance.</p>\r\n", slug: "pacte-parcours-d-acces-aux-carrieres-territoriales-hospitalieres-et-d-etat", short_description: "Parcours spécifique pour accéder à un emploi dans la fonction publique sans concours", how_much: "<p>Vous signez un contrat de droit public &agrave; temps plein, d&#39;une dur&eacute;e minimale de 12 mois et maximale de 2 ans. Pendant votre contrat, vous suivez une formation en alternance.</p>\r\n\r\n<p>A l&#39;issue du PACTE, vous pouvez obtenir le titre ou le dipl&ocirc;me requis et, si vous &ecirc;tes jug&eacute;/e apte, vous &ecirc;tes titularis&eacute;/e dans l&#39;emploi pour lequel vous avez &eacute;t&eacute; recrut&eacute;/e.*</p>\r\n", additionnal_conditions: "<p>Le PACTE pr&eacute;voit une titularisation dans la fonction publique, vous devez donc &ecirc;tre :</p>\r\n\r\n<ul>\r\n\t<li>de nationalit&eacute; fran&ccedil;aise</li>\r\n</ul>\r\n\r\n<p>ou</p>\r\n\r\n<ul>\r\n\t<li>ressortissant/e d&#39;un des Etats membres de l&#39;Union europ&eacute;enne ou de l&#39;EEE</li>\r\n</ul>\r\n\r\n<p>ou</p>\r\n\r\n<ul>\r\n\t<li>en cours de naturalisation ou d&#39;acquisition de l&#39;une des nationalit&eacute;s mentionn&eacute;es (si la proc&eacute;dure est avanc&eacute;e).</li>\r\n</ul>\r\n", how_and_when: "<p>Vous pouvez <a href=\"https://www.fonction-publique.gouv.fr/score/autres-recrutements/pacte-a-letat/avis-de-recrutement-dans-cadre-pacte\" rel=\"noopener\" target=\"_blank\">postuler aux offres labellis&eacute;es PACTE.</a></p>\r\n\r\n<p>Vous devez pr&eacute;senter votre candidature &agrave; l&#39;agence locale P&ocirc;le emploi dont vous d&eacute;pendez, en d&eacute;crivant votre parcours (formation, exp&eacute;rience, ...).</p>\r\n", limitations: "<p>* en cas d&#39;&eacute;chec &agrave; l&#39;&eacute;valuation, si vous n&#39;obtenez pas la qualification requise ou en cas de d&eacute;faillance de l&#39;organisme de formation, le PACTE peut &ecirc;tre renouvel&eacute; un an. Autrement, le contrat prend fin : vous pouvez alors vous inscrire comme demandeur d&#39;emploi et faire une demande d&#39;allocation ch&ocirc;mage qui sera examin&eacute;e.</p>\r\n", rule_id: 91, ordre_affichage: 52, contract_type_id: 5, archived_at: nil, last_update: ""},
  {name: "Immersion professionnelle (PMSMP)", what: "<p>Aide &agrave; l&#39;orientation permettant de d&eacute;couvrir un m&eacute;tier/ un secteur d&#39;activit&eacute; ou de confirmer un projet professionnel, gr&acirc;ce &agrave; une immersion dans l&#39;entreprise.</p>\r\n\r\n<p>La PMSMP d&eacute;signe une P&eacute;riode de Mise en Situation en Milieu Professionnel.&nbsp;</p>\r\n\r\n<p>Il s&#39;agit d&#39;une prestation pour laquelle vous pouvez solliciter les autres aides &agrave; la mobilit&eacute; si vous y &ecirc;tes &eacute;ligible (d&eacute;placement, repas, h&eacute;bergement, garde d&#39;enfant).</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", slug: "pmsmp", short_description: "PMSMP Période de mise en situation en milieu professionnel", how_much: "<p>La PMSMP vous permet d&#39;&ecirc;tre en immersion professionnelle dans une entreprise qui vous accueille afin de vous confronter aux conditions r&eacute;elles du poste.</p>\r\n\r\n<p>L&#39;immersion dure maximum un mois.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", additionnal_conditions: "<p>Seules les personnes morales peuvent vous accueillir en immersion professionnelle (num&eacute;ro de siret requis) : les particuliers employeurs ne peuvent pas vous accueillir en PMSMP.&nbsp;</p>\r\n\r\n<p>Certains crit&egrave;res d&#39;&eacute;ligibilit&eacute; n&#39;ont pas pu &ecirc;tre calcul&eacute;s : dans le cas o&ugrave; le calcul vous rend in&eacute;ligible, il se peut que votre situation modifie ce r&eacute;sultat.&nbsp;</p>\r\n\r\n<p>Ainsi, vous pouvez &ecirc;tre &eacute;ligible &agrave; la PMSMP si :</p>\r\n\r\n<ul>\r\n\t<li>vous n&#39;&ecirc;tes pas inscrit(e) mais vous recherchez un emploi</li>\r\n\t<li>vous &ecirc;tes suivi(e) par une mission locale</li>\r\n\t<li>vous &ecirc;tes salari&eacute;(e) dans une structure d&#39;insertion par l&#39;activit&eacute; &eacute;conomique</li>\r\n\t<li>vous &ecirc;tes salari&eacute;(e) menac&eacute;(e) d&#39;inaptitude et que vous entamez une d&eacute;marche de maintien dans l&#39;emploi ou de reconversion.</li>\r\n</ul>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", how_and_when: "<p>Vous pouvez mentionner le souhait de r&eacute;aliser une immersion professionnelle aupr&egrave;s de l&#39;organisme qui vous accompagne : <a href=\"http://www.pole-emploi.fr/accueil/\" rel=\"noopener\" target=\"_blank\">P&ocirc;le emploi</a>, <a href=\"https://www.unml.info\" rel=\"noopener\" target=\"_blank\">mission locale</a>, <a href=\"http://www.capemploi.com/\" rel=\"noopener\" target=\"_blank\">Cap emploi</a> ou structure d&#39;insertion par l&#39;activit&eacute; &eacute;conomique.</p>\r\n\r\n<p>Si le projet est pertinent, une convention est r&eacute;alis&eacute;e par l&#39;organisme prescripteur. Elle est sign&eacute;e par vous-m&ecirc;me et par la structure qui vous accueille et vous pouvez d&eacute;marrer l&#39;immersion &agrave; la date convenue.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", limitations: "<p>PMSMP possible sous r&eacute;serve de validation par l&#39;organisme prescripteur.</p>\r\n\r\n<p>Pour voir un exemple de PMSMP en vid&eacute;o, rendez-vous sur <a href=\"https://www.pole-emploi.fr/employeur/accueillir-un-demandeur-d-emploi-en-immersion-professionnelle-@/article.jspz?id=80898\" rel=\"noopener\" target=\"_blank\">P&ocirc;le-emploi.fr.</a></p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", rule_id: 37, ordre_affichage: 10, contract_type_id: 4, archived_at: nil, last_update: ""},
  {name: "Service Militaire Volontaire (SMV)", what: "<p>Il existe deux types d&#39;engagements, d&#39;une dur&eacute;e de 6 &agrave; 12 mois :</p>\r\n\r\n<p><strong>Vous &ecirc;tes non dipl&ocirc;m&eacute;/e ou titulaire d&rsquo;un dipl&ocirc;me inf&eacute;rieur au BEP, CAP ou baccalaur&eacute;at : vous pouvez &ecirc;tre Volontaire stagiaire.</strong></p>\r\n\r\n<p>Le SMV vous apporte :</p>\r\n\r\n<ul>\r\n\t<li>Une formation certifi&eacute;e permettant d&#39;&eacute;laborer ou de confirmer votre parcours professionnel, en fonction des diff&eacute;rents m&eacute;tiers propos&eacute;s</li>\r\n\t<li>Vous b&eacute;n&eacute;ficiez d&rsquo;une formation adapt&eacute;e, reconnue par un titre ou une qualification, dans un cadre militaire</li>\r\n</ul>\r\n\r\n<p><strong>Vous &ecirc;tes dipl&ocirc;m&eacute;/e d&#39;un BEP, CAP ou baccalaur&eacute;at : vous pouvez &ecirc;tre Volontaire technicien.</strong></p>\r\n\r\n<p>Le SMV vous apporte :</p>\r\n\r\n<ul>\r\n\t<li>une aide pour confirmer votre parcours professionnel, en fonction des diff&eacute;rents m&eacute;tiers propos&eacute;s, et de vos dipl&ocirc;mes et qualifications dans votre secteur d&rsquo;activit&eacute;</li>\r\n\t<li>un compl&eacute;ment &agrave; vos acquis professionnels en tant qu&rsquo;aide-moniteur/trice de formation professionnelle au profit des volontaires stagiaires.</li>\r\n</ul>\r\n\r\n<p>Au contact avec les entreprises partenaires, vous pourrez valoriser votre profil, en vue d&rsquo;un recrutement ult&eacute;rieur, en justifiant d&rsquo;une premi&egrave;re exp&eacute;rience de management de petites &eacute;quipes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dans les 2 types d&#39;engagements, volontaire stagiaire ou volontaire technicien, vous avez la possibilit&eacute; de passer le permis de conduire et vous recevez une formation aux premiers secours.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", slug: "service-militaire-volontaire-smv", short_description: "Le SMV aide à élaborer ou à confirmer un parcours professionnel", how_much: "<p>Vous b&eacute;n&eacute;ficiez d&#39;une prise en charge totale pendant toute la dur&eacute;e de votre engagement au SMV (logement, nourriture, habillement&hellip;).<br />\r\nVous &ecirc;tes aussi aid&eacute;/e dans vos d&eacute;marches (logement&hellip;.) afin de mieux pr&eacute;parer votre insertion dans l&rsquo;emploi.</p>\r\n\r\n<p>En tant que Volontaire stagiaire, vous recevez 313 &euro; nets par mois.</p>\r\n\r\n<p>En tant que Volontaire technicien, vous recevez 675 &euro; nets par mois.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", additionnal_conditions: "<p>Vous &ecirc;tes :</p>\r\n\r\n<ul>\r\n\t<li>de nationalit&eacute; fran&ccedil;aise</li>\r\n\t<li>r&eacute;sident/e en m&eacute;tropole</li>\r\n\t<li>apte m&eacute;dicalement</li>\r\n\t<li>en r&egrave;gle avec les obligations de la journ&eacute;e de d&eacute;fense et de citoyennet&eacute;&nbsp; (JDC)</li>\r\n</ul>\r\n\r\n<p>Vous avez un casier judiciaire compatible avec l&#39;exercice du m&eacute;tier militaire.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", how_and_when: "<p>Vous devez compl&eacute;ter et transmettre un dossier de candidature &agrave; l&#39;un des centres SMV : <a href=\"https://www.defense.gouv.fr/smv/presentation/presentation-generale\" rel=\"noopener\" target=\"_blank\">site du SMV</a>.</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", limitations: "<p>&nbsp;</p>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n\r\n<div id=\"sconnect-is-installed\" style=\"display: none;\">2.5.0.0</div>\r\n", rule_id: 133, ordre_affichage: 48, contract_type_id: 4, archived_at: nil, last_update: "Mars"},
  {name: "Contrat d'insertion dans la vie sociale (CIVIS)", what: "<p>Le CIVIS est sign&eacute; avec la <a href=\"http://www.mission-locale.fr/\" target=\"_blank\" rel=\"noopener\">mission locale</a> ou la permanence d'Accueil d'Information et d'Orientation (PAIO) qui d&eacute;signe un conseiller r&eacute;f&eacute;rent.</p>\r\n<p>Ce conseiller va vous accompagner pour r&eacute;aliser votre projet d'insertion au travers de diverses actions : entretiens, ateliers collectifs, mises en situation professionnelle, propositions d'emploi, de stage, de formation, ...</p>\r\n<p>Le CIVIS est conclu pour une dur&eacute;e d'un an.</p>", slug: "civis-contrat-d-insertion-dans-la-vie-sociale", short_description: "Accompagnement vers l'accès à un emploi durable", how_much: "<p>Une aide financi&egrave;re peut &ecirc;tre propos&eacute;e si vous ne percevez aucune r&eacute;mun&eacute;ration au titre d'un emploi ou d'un stage, ni d'autres allocations.</p>\r\n<p>Elle est vers&eacute;e chaque mois et peut &ecirc;tre suspendue ou supprim&eacute;e en cas de non respect des engagements au titre du CIVIS.</p>\r\n<p>Son montant varie selon votre situation personnelle et votre projet d'insertion, et dans la limite maximum de 15 euros sur 1 jour, 450 euros sur 1 mois et 1800 euros sur 1 an.</p>", additionnal_conditions: "<p>Le CIVIS b&eacute;n&eacute;ficie notamment aux personnes dont le niveau de qualification est inf&eacute;rieur ou &eacute;quivalent bac g&eacute;n&eacute;ral mais il existe des d&eacute;rogations possibles si vous n'avez pas achev&eacute; le premier cycle de l'enseignement sup&eacute;rieur et que vous rencontrez des difficult&eacute;s particuli&egrave;res d'insertion.</p>", how_and_when: "<p>Pour b&eacute;n&eacute;ficier du CIVIS, contactez la <a href=\"http://www.mission-locale.fr/\" target=\"_blank\" rel=\"noopener\">mission locale</a> ou la PAIO dont vous d&eacute;pendez.</p>", limitations: "", rule_id: 83, ordre_affichage: 42, contract_type_id: 6, archived_at: "2018-01-18 15:11:59", last_update: nil},
  {name: "Garantie Jeunes", what: "<p>La garantie jeunes est un accompagnement r&eacute;alis&eacute; par la mission locale. Elle permet d&#39;acqu&eacute;rir une premi&egrave;re exp&eacute;rience professionnelle, de se former ou de consolider son projet professionnel. &nbsp;</p>\r\n", slug: "garantie-jeunes", short_description: "Accompagnement social et professionnel assorti d'un soutien financier", how_much: "<p>Vous recevez une allocation forfaitaire mensuelle de 484,82 euros, cumulable avec les revenus de votre activit&eacute; jusqu&#39;&agrave; 300 euros (au-del&agrave; de 300 euros, l&#39;allocation devient d&eacute;gressive).</p>\r\n\r\n<p>L&#39;allocation n&#39;est plus vers&eacute;e si le total de vos ressources atteint 80% du montant du Smic (soit 1216 euros en 2019).</p>\r\n", additionnal_conditions: "<p>Vous vivez hors du foyer de vos parents ou vous ne recevez aucun soutien financier de leur part.</p>\r\n\r\n<p>Vous n&#39;&ecirc;tes ni &eacute;tudiant(e), ni en formation, ni en emploi.</p>\r\n\r\n<p>Votre niveau de ressources est faible.*</p>\r\n", how_and_when: "<p>Vous pouvez vous adresser &agrave; une <a href=\"https://www.unml.info/\" target=\"_blank\">mission locale</a> pour demander &agrave; b&eacute;n&eacute;ficier de la Garantie Jeunes.</p>\r\n\r\n<p>Cette demande est ensuite examin&eacute;e par une commission qui va notamment appr&eacute;cier votre motivation et votre disponibilit&eacute; &agrave; vous engager dans un parcours d&#39;accompagnement.</p>\r\n\r\n<p>Si la commission d&eacute;cide l&#39;attribution de la Garantie Jeunes, vous concluez un contrat d&#39;un an avec la mission locale.</p>\r\n", limitations: "<p>* Le niveau de vos ressources ne doit pas d&eacute;passer le RSA socle (484,82 euros si vous &ecirc;tes seul/e, sans enfant, et sans percevoir l&#39;aide au logement), mais il peut y avoir des d&eacute;rogations sur ce crit&egrave;re.&nbsp;</p>\r\n\r\n<p>Les allocations ch&ocirc;mage et les indemnit&eacute;s de stages notamment sont int&eacute;gr&eacute;es dans le calcul de vos ressources.</p>\r\n\r\n<p>L&#39;allocation n&#39;est pas cumulable avec :</p>\r\n\r\n<ul>\r\n\t<li>l&#39;indemnit&eacute; de service civique&nbsp;</li>\r\n\t<li>la prime d&#39;activit&eacute; (sauf si vous avez une personne &agrave; charge ou si la prime est vers&eacute;e au titre d&#39;une activit&eacute; ant&eacute;rieure &agrave; votre entr&eacute;e en Garantie Jeunes)</li>\r\n\t<li>le RSA (sauf si vous avez une personne &agrave; charge)</li>\r\n</ul>\r\n", rule_id: 92, ordre_affichage: 14, contract_type_id: 4, archived_at: nil, last_update: "Mai 2018"},
  {name: "Volontariat associatif", what: "<p>Le volontariat associatif vise &agrave; renforcer la coh&eacute;sion nationale et la mixit&eacute; sociale par des actions vari&eacute;es (par exemple, r&eacute;insertion de d&eacute;tenus, protection de l&#39;environnement, ...).</p>\r\n\r\n<p>La mission peut se d&eacute;rouler en France ou &agrave; l&#39;&eacute;tranger et doit durer entre 24 heures et 48 heures par semaine et de 6 &agrave; 24 mois.*</p>\r\n\r\n<p>Elle s&#39;effectue aupr&egrave;s d&#39;une association ou d&#39;une fondation agr&eacute;&eacute;e par l&#39;Etat ou aupr&egrave;s d&#39;un &eacute;tablissement public situ&eacute; en France (par exemple, dans des chambres consulaires ou des Offices publics de l&#39;Habitat, ...).</p>\r\n\r\n<p>Il ne s&#39;agit pas d&#39;un contrat de travail.</p>\r\n", slug: "volontariat-associatif", short_description: "Mission à caractère éducatif, environnemental, humanitaire, sportif...", how_much: "<p>En tant que volontaire, vous b&eacute;n&eacute;ficiez d&#39;une indemnit&eacute; qui varie entre 116,85 euros et 782,49 euros selon le temps que vous consacrez &agrave; la mission.</p>\r\n\r\n<p>Vous percevez &eacute;galement une prestation en nature ou en esp&egrave;ces plafonn&eacute;e &agrave; 50% de l&#39;indemnit&eacute;, afin de couvrir vos frais de restauration ou de transport.&nbsp;</p>\r\n", additionnal_conditions: "<p>Vous devez &ecirc;tre citoyen d&#39;un pays de l&#39;EEE</p>\r\n\r\n<p>ou&nbsp;</p>\r\n\r\n<p>R&eacute;sider l&eacute;galement en France depuis au moins un an</p>\r\n\r\n<p>ou</p>\r\n\r\n<p>Etre ressortissant/e d&#39;un pays o&ugrave; sont affect&eacute;s des volontaires fran&ccedil;ais</p>\r\n\r\n<p>&nbsp;</p>\r\n", how_and_when: "<p>Vous devez vous adresser aux <a href=\"http://www.service-civique.gouv.fr/page/les-referents\" rel=\"noopener\" target=\"_blank\">r&eacute;f&eacute;rents service civique</a> de votre r&eacute;gion de r&eacute;sidence.</p>\r\n", limitations: "<p>* La dur&eacute;e cumul&eacute;e entre plusieurs missions est de 36 mois maximum.</p>\r\n\r\n<p>Il peut y avoir des d&eacute;rogations sur le crit&egrave;re d&#39;&acirc;ge si vous avez entre 18 et 25 ans.</p>\r\n", rule_id: 186, ordre_affichage: 53, contract_type_id: 5, archived_at: nil, last_update: ""}
])
